      SELECT col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + ( + + col2 ) * + - col2 + - col2 BETWEEN NULL AND - + 23 * - - 71 + - - 67;
  - name: tab0

outputs:
  - name: q4499.out
    data: |
      21
